    data: |
      SELECT ALL * FROM tab2 (FORMAT parquet) AS cor0 WHERE col1 NOT IN ( - + CAST ( + col1 AS INTEGER ), + 39 / col0 * - + 16 * - col2, + 73 );
  - name: tab2

outputs:
  - name: q5233.out
    data: |
      46	51	23
      64	77	40
      75	67	58
